import React, { Component } from 'React';
import SHOP_DATA from  './shop.data.jsx';

class ShopPage extends Component {
	constructor(props){
		super(props);
		this.state = {
			collections: SHOP_DATA
		}
	}

	render(){
		return(
			<div>SHOP PAGE</div>
		)
	}
}

export default ShopPage;
